INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "お！\nあそこに困ってそうな人発見！", 0, 1, 1.4, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1001, 2, 0, 0, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 0, "春咲 ひより", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "大切な人を\n守れるようになりたい…って", 0, 1, 1.4, "みんなみたいに\nわたしも強くならなきゃ", 1002, 2, 0, 0, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", 0, "草野 優衣", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "キミに必要な集中力と感性が", 0, 1, 1.4, "フェンシングを始めてみては？", 1003, 2, 0, 0, 0, "少しは磨かれると思いますよ。", 0, "士条 怜", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "今日はなにして遊ぶ？", 0, 1, 1.5, "ねぇ、にいちゃん！", 1004, 2, 0, 0, 0, "みそぎはねぇ、\nかくれんぼやりたい！", 0, "穂高 みそぎ", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "ねぇ…", 0, 1, 1.4, "風宮あかりです", 1006, 2, 0, 0, 0, "私といっしょに…\nいかない？", 0, "風宮 あかり", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "プリンたべたいのー", 0, 1, 1.5, "出雲宮子なのー", 1007, 2, 0, 0, 0, "食べ物の恨みは怖いのー", 0, "出雲 宮子", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "キミもボクの美貌に\n吸い寄せられたんだね。", 0, 1, 1.4, "ボクは虹村雪。", 1008, 2, 0, 0, 0, "いいよ。\n見られることは運命さ…", 0, "虹村 雪", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, 1, 1.4, "フッ…聞いて後悔するがいい！", 1009, 2, 0, 0, 0, "人呼んで「疾風の冥姫」!!", 0, "柊杏奈", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, 1, 1.5, "マホマホ王国のプリンセス、\nまほ姫どす", 1010, 2, 0, 0, 0, "ほんまおおきにやわ～♪", 0, "姫宮 真歩", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "生き別れたお兄ちゃんを探して\n三千世界！", 0, 1, 1.4, "衣之咲璃乃です！", 1011, 2, 0, 0, 0, "ここで会ったが\n100年目～！", 0, "衣之咲 璃乃", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "ち、超能力って…\n何のことかな～？", 0, 1, 1.4, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1012, 2, 0, 0, 0, "…って、お願い！\n誰にも言わないでおいて～！", 0, "柏崎 初音", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "一応カリスマ読モJKやってまっす！", 0, 1, 1.4, "ちょす！\n美波鈴奈だよ～♪", 1016, 2, 0, 0, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 0, "美波 鈴奈", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "東京は遊園地みたいなところさー", 0, 1, 1.4, "はいたーい。\n喜屋武香織さー。", 1017, 2, 0, 0, 0, "でも、沖縄もとってもいいとこさー", 0, "喜屋武 香織", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "先生って呼ばれるのは\nくすぐったいから", 0, 1, 1.4, "支倉伊緒です。", 1018, 2, 0, 0, 0, "イオちゃんって呼んでね。", 0, "支倉 伊緒", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "あ！/\お兄ちゃ～ん\nまってよ～", 0, 1, 1.5, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1020, 2, 0, 0, 0, "ミミをおいてかないでぇ～", 0, "茜 ミミ", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "あの……\nふぇ……", 0, 1, 1.5, "あ…あの…えっと…\n栗…林…くるみ…です……", 1021, 2, 0, 0, 0, "ふぇぇぇぇぇん……", 0, "栗林 くるみ", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "こんな私に貴重な時間を\n割いていただき、", 0, 1, 1.4, "風宮よりです。\nあああああ！", 1022, 2, 0, 0, 0, "なんてありがとうございます！", 0, "風宮 より", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "おにいちゃんどこいくの？\nえ？", 0, 1, 1.5, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1023, 2, 0, 0, 0, "私こっち行きたいー\nね、早く早くー", 0, "北条 綾音", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "ふ、不束者ですが\nどうぞ末永く…って、", 0, 1, 1.4, "わっ…わっ…私、\n天野すずめといいます！", 1025, 2, 0, 0, 0, "これて何か違う…\nあああすみません！", 0, "天野 すずめ", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "あなたは…運命の……\n伴侶……", 0, 1, 1.4, "……クスクス…私は\n…倉石恵理子……", 1027, 2, 0, 0, 0, "離しませんわ………\n絶対に…!!", 0, "倉石 恵理子", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, 1, 1.4, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1028, 2, 0, 0, 0, "…そうでしょ？？", 0, "佐々木 咲恋", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "ぇっと…\nキミ、私のこと知らないの?!", 0, 1, 1.4, "桜井望だよ！\nよろしくねっ", 1029, 2, 0, 0, 0, "あはは、\n私もまだまだだなぁ～", 0, "桜井 望", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "初めまして、\n私はニノン・ジュベール申すデス！", 0, 1, 1.4, "デケデケデンっ！", 1030, 2, 0, 0, 0, "ショーグン、\nワタシと一緒に天下統一デース！", 0, "ニノン・ジュベール", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "でもって私の隣にいるのが……\nえ、見えない？", 0, 1, 1.4, "上喜しのぶです。\n手元のドクロが父です。", 1031, 2, 0, 0, 0, "おかしいですね……", 0, "上喜 しのぶ", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "けんども\nそれには足りないモンが…", 0, 1, 1.5, "目指すはビッグな\nお笑い芸人だっぺ！", 1033, 2, 0, 0, 0, "そう、\nオラのボケに突っ込める相方が…！", 0, "野戸まひる", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "ちょっと緊張しちゃって…", 0, 1, 1.4, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1034, 2, 0, 0, 0, "ちょ\nちょっと一杯飲んできます…！", 0, "綾瀬 ゆかり", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "知らない人とは話しちゃいけないので", 0, 1, 1.5, "氷川鏡華…です", 1036, 2, 0, 0, 0, "これ以上お話しすることは…\nないです！", 0, "氷川 鏡華", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "……あ、アラーム。", 0, 1, 1.4, "柏崎…栞です。", 1038, 2, 0, 0, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 0, "柏崎 栞", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "私、一人も友達がいなくて……", 0, 1, 1.4, "ふ、双葉碧です。", 1040, 2, 0, 0, 0, "野に咲く花が、\n唯一の話相手です。", 0, "双葉 碧", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0, 1, 1.4, "三角千歌です。", 1042, 2, 0, 0, 0, "そう思っています。", 0, "三角 千歌", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "あぁ？\nお前のそいつの仲間か？", 0, 1, 1.4, "安芸真琴だ。", 1043, 2, 0, 0, 0, "う、疑ってすまなかったな…", 0, "安芸 真琴", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "生けとし生ける全ての者よ！", 0, 1, 1.4, "わらわこそは夜を総べる者！", 1044, 2, 0, 0, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 0, "イリヤ・オーンスタイン", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "ぐふふふふ……はっ！", 0, 1, 1.4, "そこで騎士は妖精を乱暴に……", 1045, 2, 0, 0, 0, "ｌク、クウカに何かご用ですか!?", 0, "遠見 空花", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0, 1, 1.4, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1046, 2, 0, 0, 0, "う～ん…\n猫ってホントに最高にゃ～♪", 0, "宮坂たまき", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "それでは早速クエストに…", 0, 1, 1.4, "大神美冬よ！", 1048, 2, 0, 0, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 0, "大神 美冬", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "クエストもバトルも\n掃除も洗濯も", 0, 1, 1.4, "星野静流だよ！", 1049, 2, 0, 0, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 0, "星野静流", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "見ての通りの\nセクシー美少女で", 0, 1, 1.5, "アタシは玉泉美咲。", 1050, 2, 0, 0, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 0, "玉泉美咲", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "？？？？", 0, 1, 1.4, "？？？", 1052, 2, 0, 0, 0, "？？？？", 0, "リマ", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "菓子でつろうなどと\n稚拙な策を……", 0, 1, 1.5, "モニカ・ヴァイスヴィントだ。", 1053, 2, 0, 0, 0, "そ、そこまでいうなら\nもらってやる", 0, "モニカ・ヴァイスヴィント", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "菓子でつろうなどと\n稚拙な策を……", 0, 1, 1.5, "モニカ・ヴァイスヴィントだ。", 1058, 2, 0, 0, 0, "そ、そこまでいうなら\nもらってやる", 0, "ペコリーヌ", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "菓子でつろうなどと\n稚拙な策を……", 0, 1, 1.5, "モニカ・ヴァイスヴィントだ。", 1059, 2, 0, 0, 0, "そ、そこまでいうなら\nもらってやる", 0, "コッコロ", 1);
INSERT INTO `v1_58135c2cf5a14d93c1d9b40430f17e4efedb083c928002506b85cbbdec5e1352` VALUES (1, "菓子でつろうなどと\n稚拙な策を……", 0, 1, 1.5, "モニカ・ヴァイスヴィントだ。", 1060, 2, 0, 0, 0, "そ、そこまでいうなら\nもらってやる", 0, "キャル", 1);
